import React, { useState } from "react";

function PageNumber(props) {
  const [pageNumber, setPageNumber] = useState(1);

  const handleClick = (input) => {
    const selectedPageNumber = input.target.value;
    setPageNumber(selectedPageNumber)
    props.PageNumber = selectedPageNumber;
  };

  return (
    <div>
        <label for="resPerPage">Results per page:</label>
        <select name="resPerPage" id="resPerPage" onChange={handleClick}>
        <option value="ten">10</option>
        <option value="twenty">20</option>
        <option value="fifty">50</option>
        </select>
    </div>
  );
}

export default PageNumber;
